	function editForm(result) {
    	var invoiceInfo = result.invoiceInfo; 
    	var orderEqpList = result.orderEqpList; 
    	var orderPartList = result.orderPartList; 
    	var eqpHwOptList = result.eqpHwOptList; 
    	var packingInfo = result.packingInfo; 

		var f = document.saveForm;

		$("#ci_sndmail_seq").val(invoiceInfo.ci_sndmail_seq);
		$("#txt_pi_no").html("PI-" + invoiceInfo.pi_no + "-" + invoiceInfo.pi_sndmail_seq);

		var buyer = "SAME AS CONSIGNEE";
		if(invoiceInfo.buyer!=invoiceInfo.csn_attn){
			buyer = invoiceInfo.buyer;
		}
		$("#buyer").html(buyer);
		
		$("#csn_cmpy_nm").html(invoiceInfo.csn_cmpy_nm);
		$("#csn_addr").html(invoiceInfo.csn_addr);
		$("#csn_tel").html("Tel : " + invoiceInfo.csn_tel);
		$("#csn_fax").html("Fax : " + invoiceInfo.csn_fax);
		$("#csn_attn").html("Attn: " + invoiceInfo.csn_attn);
		$("#cntry").html(", " + invoiceInfo.cntry);
		
		$("#txt_invoice_dt").html(invoiceInfo.txt_invoice_dt);
		$("#destnt").html(invoiceInfo.destnt + ", " + invoiceInfo.cntry);
		$("#inv_payment").html(invoiceInfo.inv_payment);

		var txt_invoice_no = "SWI-" + invoiceInfo.pi_no;
		$("#txt_invoice_no").html(txt_invoice_no);
		$("#txt_ship_port_atcd").html(invoiceInfo.txt_ship_port_atcd);
		if(invoiceInfo.ci_sndmail_seq!=null){
			$("#txt_invoice_no").append("-" + invoiceInfo.ci_sndmail_seq);
		}

		var tot_cartons = 0;
		var mdl_nm = "";
		var eqp_qty = 0;
		var eqp_net_wgt = 0.0;
		var eqp_gross_wgt = 0.0;
		if(orderEqpList!=null){
	        eqpDiv.style.display = ""
			$.each(orderEqpList, function(key) {
				var targetInfo = orderEqpList[key];
//				fn_addEqpRow('carton_list_div', targetInfo);
				mdl_nm += targetInfo.mdl_nm + "  Currency Discrimination Counter ( " + targetInfo.eqp_qty + " )<br>";
				eqp_qty += eval(targetInfo.eqp_qty);
				eqp_net_wgt += eval(targetInfo.net_wgt) * eqp_qty;
				eqp_gross_wgt += eval(targetInfo.gross_wgt) * eqp_qty;
			})
			eqp_net_wgt = eqp_net_wgt.toFixed(2);
	        $("#mdl_nm").html(mdl_nm);
	        $("#eqp_qty_div").html(eqp_qty + " Cartons");
	        $("#eqp_net_wgt_div").html(eqp_net_wgt + " Kg");
	        $("#eqp_gross_wgt").val(eqp_gross_wgt);
		}
		
		tot_cartons += eval(eqp_qty);
        $("#tot_eqp_qty").val(tot_cartons);
               
		
		var spare_parts = "Currency Discrimination Counter Spare Parts";
		var part_net_wgt = 0;
		var part_gross_wgt = 0;
		if(orderPartList!=null){
			spareDiv.style.display = "";
			$.each(orderPartList, function(key) {
				var targetInfo = orderPartList[key];
				part_net_wgt = eval(targetInfo.net_wgt);
			})
	        $("#spare_parts").html(spare_parts);
	        $("#part_net_wgt_div").html(part_net_wgt + " Kg");

	 		if(packingInfo!=null){
				part_gross_wgt = part_net_wgt + eval(packingInfo.part_cartons);
		        $("#part_gross_wgt").val(part_gross_wgt);
			}
		}
		 		
		if(invoiceInfo.repr_qty!=null || eqpHwOptList!=null){
			addonDiv.style.display = "";
			var addon = "Addon - ";
			if(eqpHwOptList!=null){
				addon += "HW Option";
			}
			if(eqpHwOptList!=null || invoiceInfo.repr_qty!=null){
				addon += ", ";
			}
			if(invoiceInfo.repr_qty!=null){
				addon += "Repair Parts";
			}
			$("#addon_div").html(addon);
		}
		
		if(packingInfo!=null){
 	        $("#eqp_carton_no").val(packingInfo.eqp_carton_no);
 	        $("#eqp_gross_wgt").val(packingInfo.eqp_gross_wgt);

	        $("#part_carton_no").val(packingInfo.part_carton_no);
	        $("#part_cartons").val(packingInfo.part_cartons);
	        $("#part_gross_wgt").val(packingInfo.part_gross_wgt);
	        
 	        $("#addon_carton_no").val(packingInfo.addon_carton_no);
	        $("#addon_cartons").val(packingInfo.addon_cartons);
	        $("#addon_gross_wgt").val(packingInfo.addon_gross_wgt);
 	        
			tot_cartons += eval(packingInfo.addon_cartons);
			$("#tot_cartons").html(packingInfo.tot_cartons + " Cartons");
		    $("#tot_gross_wgt").html(packingInfo.tot_gross_wgt + " Kg");

			if(packingInfo.sndmail_seq!=null){
				$('#btnSave').attr('disabled',true);
			}
			if(invoiceInfo.wrk_tp_atcd=="00700610"){
				$('#btnEdit').attr('disabled',true);
				$('#btnMail').attr('disabled',true);
				$('#btnExcel').attr('disabled',false);
			}else{
//				$('#btnExcel').attr('disabled',true);
			}
		}else{
			$("#tot_cartons").html(tot_cartons + " Cartons");
			$('#btnSend').attr('disabled',true);
		}
		
	}

