	function fn_isValid(){
		if(eqpDiv.style.display==""){
			if($("#eqp_carton_no").val()==""){
				alert("Carton No. is required!");
				$("#eqp_carton_no").focus();
				return false;
			}
			if($("#eqp_gross_wgt").val()==""){
				alert("Gross Weight. is required!");
				$("#eqp_gross_wgt").focus();
				return false;
			}
		}
		if(spareDiv.style.display==""){
			if($("#part_carton_no").val()==""){
				alert("Carton No. is required!");
				$("#part_carton_no").focus();
				return false;
			}
			if($("#part_cartons").val()==""){
				alert("Quantity. is required!");
				$("#part_cartons").focus();
				return false;
			}
		}
		if(addonDiv.style.display==""){
			if($("#addon_carton_no").val()==""){
				alert("Carton No. is required!");
				$("#addon_carton_no").focus();
				return false;
			}
			if($("#addon_cartons").val()==""){
				alert("Quantity. is required!");
				$("#addon_cartons").focus();
				return false;
			}
			if($("#addon_gross_wgt").val()==""){
				alert("Gross Weight. is required!");
				$("#addon_gross_wgt").focus();
				return false;
			}
		}
		return true;
	}
	
	function fn_save() {
		var f = document.saveForm;
		
		if(!fn_isValid()){
			return;
		}
		f.action = "/index.php/admin/outer/savePacking";

		$('#btnSave').attr('disabled',true);
		$('#btnSend').attr('disabled',true);

//		f.submit();
//		return;
		var options = {
					type:"POST",
					dataType:"json",
			        beforeSubmit: function(formData, jqForm, options) {
//			        	$("#resultDiv").html('<b>this order is sending...</b>');
					},
			        success: function(result, statusText, xhr, $form) {
			            if(statusText == 'success'){
				            var todo = result.qryInfo.todo;	  
				            if(todo == "Y"){
					            var qryInfo = result.qryInfo;	            	
			    				if(qryInfo.result2==false)
			    		        {
			    					$("#error").html("<span style='color:#cc0000'>Error:</span> Sql Error!. " + qryInfo.sql2);
			            			return;
			    				}else{
//			    		        	alert(qryInfo.result2 + ":" + qryInfo.sql2);
			    				}
				            }else if(todo == "N"){
					            var txt_wrk_tp_atcd = result.qryInfo.txt_wrk_tp_atcd;
					            if(cnfm_yn == "Y"){
						            alert("This Packing is already confirmed!(" + txt_wrk_tp_atcd + ")");
						            return;
					            }	  
							}          	
					    	$('#btnSave').attr('disabled',false);
					    	$('#btnSend').attr('disabled',false);
					    	alert("success!");
					    	fn_send();
			            }
					},
			        /* ajax options omitted */
			        error:function(){
			        	$('#error').shake();
						$("#error").html("<span style='color:#cc0000'>Error:</span> Sql Error!. ");
					}
					
			    };
		$("#saveForm").ajaxSubmit(options);
	}
	
</script>
  
